import React, { useState, useEffect } from 'react';
import { ArrowLeft, Plus, Trash2 } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const AddSchedule = () => {
  const navigate = useNavigate();
  const [schedules, setSchedules] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  const [formData, setFormData] = useState({
    scheduleId: '',
    busId: '',
    route: 'GALLE-MAKUMBURA', // Default route
    departureTime: '',
    arrivalTime: '',
    runningNo: ''
  });

  // Predefined schedules data
  const predefinedSchedules = {
    'GALLE-MAKUMBURA': [
      { runningNo: 'SLTB-O11', departure: '15:30', arrival: '17:00' },
      { runningNo: 'G12', departure: '15:50', arrival: '17:20' },
      { runningNo: 'SLTB-O12', departure: '16:10', arrival: '17:40' },
      { runningNo: 'M4', departure: '16:30', arrival: '18:00' },
      { runningNo: 'SLTB-D4', departure: '16:50', arrival: '18:20' },
      { runningNo: 'M5', departure: '17:10', arrival: '18:40' },
      { runningNo: 'SLTB-D5', departure: '17:30', arrival: '19:00' },
      { runningNo: 'M6', departure: '18:00', arrival: '19:30' },
      { runningNo: 'SLTB-D6', departure: '18:30', arrival: '20:00' },
      { runningNo: 'M7', departure: '19:00', arrival: '20:30' },
      { runningNo: 'SLTB-D7', departure: '19:30', arrival: '21:00' }
    ],
    'MAKUMBURA-GALLE': [
      { runningNo: 'SLTB-D7', departure: '17:00', arrival: '18:30' },
      { runningNo: 'G8', departure: '17:20', arrival: '18:50' },
      { runningNo: 'SLTB-O8', departure: '17:40', arrival: '19:10' },
      { runningNo: 'G9', departure: '18:00', arrival: '19:30' },
      { runningNo: 'SLTB-O9', departure: '18:20', arrival: '19:50' },
      { runningNo: 'G10', departure: '18:40', arrival: '20:10' },
      { runningNo: 'SLTB-O10', departure: '19:00', arrival: '20:30' },
      { runningNo: 'G11', departure: '19:30', arrival: '21:00' },
      { runningNo: 'SLTB-O11', departure: '20:00', arrival: '21:30' },
      { runningNo: 'G12', departure: '20:30', arrival: '22:00' },
      { runningNo: 'SLTB-O12', departure: '21:00', arrival: '22:30' }
    ]
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:5001/api/schedules', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData)
      });

      const data = await response.json();

      if (response.ok) {
        setSuccess('Schedule added successfully!');
        setFormData({
          scheduleId: '',
          busId: '',
          route: 'GALLE-MAKUMBURA',
          departureTime: '',
          arrivalTime: '',
          runningNo: ''
        });
      } else {
        throw new Error(data.message || 'Failed to add schedule');
      }
    } catch (err) {
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      {/* Back Button */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 mb-6">
        <button
          onClick={() => navigate('/admin-dashboard')}
          className="flex items-center text-gray-600 hover:text-gray-800"
        >
          <ArrowLeft className="w-5 h-5 mr-2" />
          Back to Dashboard
        </button>
      </div>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Page Header */}
        <div className="bg-white rounded-lg shadow-sm p-6 mb-6">
          <h1 className="text-2xl font-bold text-gray-900">Schedule Management</h1>
          <p className="mt-2 text-gray-600">Add and manage bus schedules</p>
        </div>

        {/* Schedule Tables */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 mb-6">
          {/* GALLE-MAKUMBURA Schedule */}
          <div className="bg-white rounded-lg shadow-sm overflow-hidden">
            <div className="px-6 py-4 bg-gray-50 border-b border-gray-200">
              <h2 className="text-lg font-semibold text-gray-900">Galle to Makumbura</h2>
            </div>
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Running No</th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Departure</th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Arrival</th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {predefinedSchedules['GALLE-MAKUMBURA'].map((schedule, index) => (
                    <tr key={index} className="hover:bg-gray-50">
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{schedule.runningNo}</td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{schedule.departure}</td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{schedule.arrival}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>

          {/* MAKUMBURA-GALLE Schedule */}
          <div className="bg-white rounded-lg shadow-sm overflow-hidden">
            <div className="px-6 py-4 bg-gray-50 border-b border-gray-200">
              <h2 className="text-lg font-semibold text-gray-900">Makumbura to Galle</h2>
            </div>
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Running No</th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Departure</th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Arrival</th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {predefinedSchedules['MAKUMBURA-GALLE'].map((schedule, index) => (
                    <tr key={index} className="hover:bg-gray-50">
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{schedule.runningNo}</td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{schedule.departure}</td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{schedule.arrival}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>

        {/* Add Schedule Form */}
        <div className="bg-white rounded-lg shadow-sm p-6">
          <h2 className="text-xl font-semibold text-gray-900 mb-4">Add New Schedule</h2>
          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="grid grid-cols-1 gap-6 md:grid-cols-2">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Schedule ID
                </label>
                <input
                  type="text"
                  name="scheduleId"
                  value={formData.scheduleId}
                  onChange={handleChange}
                  className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Bus ID
                </label>
                <input
                  type="text"
                  name="busId"
                  value={formData.busId}
                  onChange={handleChange}
                  className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Route
                </label>
                <select
                  name="route"
                  value={formData.route}
                  onChange={handleChange}
                  className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                  required
                >
                  <option value="GALLE-MAKUMBURA">Galle to Makumbura</option>
                  <option value="MAKUMBURA-GALLE">Makumbura to Galle</option>
                </select>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Running No
                </label>
                <input
                  type="text"
                  name="runningNo"
                  value={formData.runningNo}
                  onChange={handleChange}
                  className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Departure Time
                </label>
                <input
                  type="time"
                  name="departureTime"
                  value={formData.departureTime}
                  onChange={handleChange}
                  className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Arrival Time
                </label>
                <input
                  type="time"
                  name="arrivalTime"
                  value={formData.arrivalTime}
                  onChange={handleChange}
                  className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                  required
                />
              </div>
            </div>

            {error && (
              <div className="bg-red-50 border-l-4 border-red-400 p-4">
                <div className="flex">
                  <div className="flex-shrink-0">
                    <svg className="h-5 w-5 text-red-400" viewBox="0 0 20 20" fill="currentColor">
                      <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
                    </svg>
                  </div>
                  <div className="ml-3">
                    <p className="text-sm text-red-700">{error}</p>
                  </div>
                </div>
              </div>
            )}

            {success && (
              <div className="bg-green-50 border-l-4 border-green-400 p-4">
                <div className="flex">
                  <div className="flex-shrink-0">
                    <svg className="h-5 w-5 text-green-400" viewBox="0 0 20 20" fill="currentColor">
                      <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z" clipRule="evenodd" />
                    </svg>
                  </div>
                  <div className="ml-3">
                    <p className="text-sm text-green-700">{success}</p>
                  </div>
                </div>
              </div>
            )}

            <div className="flex justify-end">
              <button
                type="submit"
                disabled={isLoading}
                className="flex items-center px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 disabled:opacity-50"
              >
                <Plus className="w-5 h-5 mr-2" />
                {isLoading ? 'Adding...' : 'Add Schedule'}
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default AddSchedule;
